Val:
每天早晨醒来第一件事浏览头条的趣闻要事，
每天晚上入睡前必须得浏览头条关注的动态。
每天工作之余总喜欢打开头条阅读历史地理，
每次烦恼不堪之时情不自禁品读头条的美文。
每次游走他乡孤独寂寞之夜头条伴随着左右，
每次和朋友们高谈阔论之本便是头条的信息。
每次炒菜黔驴技穷之时打开头条视频教会我，
每次给孩子辅导无法入手时头条早已归纳好。
每次……
头条里有喜有忧;
头条里有理有据;
头条里有国有家;
头条里有爱有恨;
头条里有你有他。
头条是万花筒;
头条是你我他;
头条是诗和画;
头条是脚与行;
头条是舍与得;

人生不仅仅有诗和远方还有头条！

